INSERT INTO `movies` VALUES (1,'Bohemian Rhapsody','Singer Freddie Mercury, guitarist Brian May, drummer Roger Taylor and bass guitarist John Deacon take the music world by storm when they form the rock \'n\' roll band Queen in 1970. Hit songs become instant classics. When Mercury\'s increasingly wild lifestyle starts to spiral out of control, Queen soon faces its greatest challenge yet – finding a way to keep the band together amid the success and excess.','2018-10-24',135,52000000,'/lHu1wtNaczFPGFDTrjCSzeLPTKN.jpg','/pbXgLEYh8rlG2Km5IGZPnhcnuSz.jpg'),(2,'The Grinch','The Grinch hatches a scheme to ruin Christmas when the residents of Whoville plan their annual holiday celebration.','2018-11-08',90,0,'/rWQVj6Z8kPdsbt7XPjVBCltxq90.jpg','/zRDkmww7Bu11wiz2g86RxSreiY4.jpg'),(3,'A Star Is Born','Seasoned musician Jackson Maine discovers—and falls in love with—struggling artist Ally. She has just about given up on her dream to make it big as a singer—until Jack coaxes her into the spotlight. But even as Ally\'s career takes off, the personal side of their relationship is breaking down, as Jack fights an ongoing battle with his own internal demons.','2018-10-03',135,36000000,'/wrFpXMNBRj2PBiN4Z5kix51XaIZ.jpg','/840rbblaLc4SVxm8gF3DNdJ0YAE.jpg'),(4,'The Girl in the Spider\'s Web','Lisbeth Salander and Mikael Blomkvist find themselves caught in a web of spies, cyber-criminals and corrupt government officials - both in Sweden and in the United States - whom are only known as The Spider Society.','2018-10-26',117,43000000,'/w4ibr8R702DCjwYniry1D1XwQXj.jpg','/lWPFKsbN1q9gSeMZypFdbI2WD15.jpg'),(5,'Ralph Breaks the Internet','Taking place six years following the events of the first film, the story will center on Ralph\'s adventures in the Internet data space when a Wi-Fi router gets plugged into the arcade as he must find a replacement part to fix Sugar Rush.','2018-11-20',112,0,'/m110vLaDDOCca4hfOcS5mK5cDke.jpg','/ivhK1NjnFji6lD5dkAThSzd3Mgq.jpg'),(6,'Overlord','On the eve of D-Day during World War II, American paratroopers are caught behind enemy lines after their plane crashes on a mission to destroy a German Radio Tower in a small town outside of Normandy. After reaching their target, the paratroopers come to realize that besides fighting off Nazi soldiers, they also must fight against horrifying, bloody, and violent creatures that are a result of a secret Nazi experiment.','2018-11-01',110,38000000,'/l76Rgp32z2UxjULApxGXAPpYdAP.jpg','/sHNC8hjAu4ZKXYhG3cp8ghRZ02B.jpg'),(7,'Alpha','In the prehistoric past, Keda, a young and inexperienced hunter, struggles to return home after being separated from his tribe when bison hunting goes awry. On his way back he will find an unexpected ally.','2018-08-17',97,51000000,'/afdZAIcAQscziqVtsEoh2PwsYTW.jpg','/hBkPmNA04BYggZQqzzvVEBVnj9m.jpg'),(8,'Night School','Teddy Walker is a successful salesman whose life takes an unexpected turn when he accidentally blows up his place of employment. Forced to attend night school to get his GED, Teddy soon finds himself dealing with a group of misfit students, his former high school nemesis and a feisty teacher who doesn\'t think he\'s too bright.','2018-09-27',111,29000000,'/1NSMAaBPSbWv7sGmF8oLGMNb8Qm.jpg','/jJBimY3DXIaIaL4NeGHfR0U0rSh.jpg'),(9,'First Man','A look at the life of the astronaut, Neil Armstrong, and the legendary space mission that led him to become the first man to walk on the Moon on July 20, 1969.','2018-10-11',141,70000000,'/i91mfvFcPPlaegcbOyjGgiWfZzh.jpg','/nCBiOnHrgpIHzjCJ0upVIZdYbtY.jpg'),(10,'Creed II','Follows Adonis Creed\'s life inside and outside of the ring as he deals with new found fame, issues with his family, and his continuing quest to become a champion.','2018-11-20',130,0,'/v3QyboWRoA4O9RbcsqH8tJMe8EB.jpg','/6JHYYbvoSuQ95ceGx8Oeg8zzAjg.jpg'),(11,'Hunter Killer','An untested American submarine captain teams with U.S. Navy Seals to rescue the Russian president, who has been kidnapped by a rogue general.','2018-10-19',122,0,'/t7ZpEIxMnxaljIeor3XB1PUX4lm.jpg','/gCIB3DdK00DyfwosVGf7pnFFdK3.jpg'),(12,'BlacKkKlansman','Ron Stallworth, an African-American police officer from Colorado, successfully manages to infiltrate the local Ku Klux Klan and become the head of the local chapter.','2018-07-30',135,15000000,'/55W6mUVv4CXMMQHHhV2zXtLSpXQ.jpg','/gMVdhfQ7q9DFHhDkehrququjGPd.jpg'),(13,'Widows','Set in contemporary Chicago, amidst a time of turmoil, four women with nothing in common except a debt left behind by their dead husbands\' criminal activities take fate into their own hands and conspire to forge a future on their own terms.','2018-11-06',128,42000000,'/f27RTnWEc2bhVtfSlKmxxypznfR.jpg','/Cf0DNn5QwoHnuaHVIDu4DgIFNo.jpg'),(14,'The House with a Clock in Its Walls','Ten-year-old Lewis goes to live with his uncle in a creaky old house that contains a mysterious ticktock noise. When Lewis accidentally awakens the dead, the town\'s sleepy facade magically springs to life with a secret world of witches and warlocks.','2018-09-15',105,42000000,'/qM66Hv4ByAxnilr0jaqCA9uOD4Y.jpg','/tQvvRReWhrXnj28s4AIp2PblByg.jpg'),(15,'The Nutcracker and the Four Realms','A young girl is transported into a magical world of gingerbread soldiers and an army of mice.','2018-10-26',93,120000000,'/aRD1vLU7k5NHO0HThfHrjEQwWRz.jpg','/l2ji4YiNSPBV69WjGBgU0gCvRqy.jpg'),(16,'Time Freak','Stillman, a heartbroken physics student, builds a time machine when his girlfriend breaks up with him. Going back in time, he attempts to save their relationship by fixing every mistake he made—while dragging his best friend along in the process.','2018-11-09',105,0,'/wYTDLIoKGAZrlCdeeKYDnQxvOC6.jpg','/8DniXQ8qDGCImpOisq9RGF3muCR.jpg'),(17,'The Favourite','In early 18th century England, a frail Queen Anne occupies the throne and her close friend Lady Sarah governs the country in her stead. When a new servant Abigail arrives, her charm endears her to Sarah.','2018-11-20',120,0,'/4hgPWxYeGWtTEx9BPhUo99wj77z.jpg','/3AHdHbrikuTqgOmF5SMyoj1iL68.jpg'),(18,'Hereditary','When Ellen, the matriarch of the Graham family, passes away, her daughter’s family begins to unravel cryptic and increasingly terrifying secrets about their ancestry.','2018-06-04',127,10000000,'/lHV8HHlhwNup2VbpiACtlKzaGIQ.jpg','/yVWiOMpzf7gullGvug83r7gMdha.jpg'),(19,'Bad Times at the El Royale','Seven strangers, each with a secret to bury, meet at Lake Tahoe\'s El Royale, a rundown hotel with a dark past in 1969. Over the course of one fateful night, everyone will have a last shot at redemption.','2018-10-04',141,0,'/iNtFgXqXPRMkm1QO8CHn5sHfUgE.jpg','/tkUpruYM2zBdbHYW9fgthbrCjV4.jpg'),(20,'Fantastic Beasts: The Crimes of Grindelwald','Gellert Grindelwald has escaped imprisonment and has begun gathering followers to his cause—elevating wizards above all non-magical beings. The only one capable of putting a stop to him is the wizard he once called his closest friend, Albus Dumbledore. However, Dumbledore will need to seek help from the wizard who had thwarted Grindelwald once before, his former student Newt Scamander, who agrees to help, unaware of the dangers that lie ahead. Lines are drawn as love and loyalty are tested, even among the truest friends and family, in an increasingly divided wizarding world.','2018-11-14',134,200000000,'/uyJgTzAsp3Za2TaPiZt2yaKYRIR.jpg','/xgbeBCjmFpRYHDF7tQ7U98EREWp.jpg'),(21,'Mission: Impossible - Fallout','When an IMF mission ends badly, the world is faced with dire consequences. As Ethan Hunt takes it upon himself to fulfill his original briefing, the CIA begin to question his loyalty and his motives. The IMF team find themselves in a race against time, hunted by assassins while trying to prevent a global catastrophe.','2018-07-13',148,178000000,'/AkJQpZp9WoNdj7pLYSj1L0RcMMN.jpg','/aw4FOsWr2FY373nKSxbpNi3fz4F.jpg'),(22,'The Predator','From the outer reaches of space to the small-town streets of suburbia, the hunt comes home. Now, the universe’s most lethal hunters are stronger, smarter and deadlier than ever before, having genetically upgraded themselves with DNA from other species. When a young boy accidentally triggers their return to Earth, only a ragtag crew of ex-soldiers and a disgruntled science teacher can prevent the end of the human race.','2018-09-13',107,88000000,'/wMq9kQXTeQCHUZOG4fAe5cAxyUA.jpg','/f4E0ocYeToEuXvczZv6QArrMDJ.jpg'),(23,'Venom','When Eddie Brock acquires the powers of a symbiote, he will have to release his alter-ego \"Venom\" to save his life.','2018-10-03',112,116000000,'/2uNW4WbgBXL25BAbXGLnLqX71Sw.jpg','/VuukZLgaCrho2Ar8Scl9HtV3yD.jpg'),(24,'The Equalizer 2','Robert McCall, who serves an unflinching justice for the exploited and oppressed, embarks on a relentless, globe-trotting quest for vengeance when a long-time girl friend is murdered.','2018-07-19',122,62000000,'/cQvc9N6JiMVKqol3wcYrGshsIdZ.jpg','/z7noaCJ4KtmhwHw7QcNtnMMo4Qy.jpg'),(25,'Avengers: Infinity War','As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.','2018-04-25',149,300000000,'/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg','/lmZFxXgJE3vgrciwuDib0N8CfQo.jpg'),(26,'The Meg','A deep sea submersible pilot revisits his past fears in the Mariana Trench, and accidentally unleashes the seventy foot ancestor of the Great White Shark believed to be extinct.','2018-08-09',114,150000000,'/eyWICPcxOuTcDDDbTMOZawoOn8d.jpg','/2uSCHUsmzb6KkQPFSxBQ7bgfJLE.jpg'),(27,'The Nun','When a young nun at a cloistered abbey in Romania takes her own life, a priest with a haunted past and a novitiate on the threshold of her final vows are sent by the Vatican to investigate. Together they uncover the order’s unholy secret. Risking not only their lives but their faith and their very souls, they confront a malevolent force in the form of the same demonic nun that first terrorized audiences in “The Conjuring 2” as the abbey becomes a horrific battleground between the living and the damned.','2018-09-05',96,22000000,'/sFC1ElvoKGdHJIWRpNB3xWJ9lJA.jpg','/fgsHxz21B27hOOqQBiw9L6yWcM7.jpg'),(28,'Incredibles 2','Elastigirl springs into action to save the day, while Mr. Incredible faces his greatest challenge yet – taking care of the problems of his three children.','2018-06-14',118,200000000,'/x1txcDXkcM65gl7w20PwYSxAYah.jpg','/mabuNsGJgRuCTuGqjFkWe1xdu19.jpg'),(29,'The Princess Switch','When a down-to-earth Chicago baker and a soon-to-be princess discover they look like twins, they hatch a Christmastime plan to trade places.','2018-11-16',101,0,'/biRUM4CBgfJtEQDCttf3zca4epp.jpg','/eZeKHAqNsDAG6r8hi4sMzwqHn5n.jpg'),(30,'Mile 22','An elite group of American operatives, aided by a top-secret tactical command team, must transport an asset who holds life-threatening information to an extraction point 22 miles away through the hostile streets of an Asian city.','2018-08-16',95,35000000,'/2L8ehd95eSW9x7KINYtZmRkAlrZ.jpg','/A2rIVEV2jOzb4smx8hby1u9UwAm.jpg'),(31,'Crazy Rich Asians','An American-born Chinese economics professor accompanies her boyfriend to Singapore for his best friend\'s wedding, only to get thrust into the lives of Asia\'s rich and famous.','2018-08-15',121,30000000,'/1XxL4LJ5WHdrcYcihEZUCgNCpAW.jpg','/1brgtigBGY1ixSudNMBq0edO1V6.jpg'),(32,'Fantastic Beasts and Where to Find Them','In 1926, Newt Scamander arrives at the Magical Congress of the United States of America with a magically expanded briefcase, which houses a number of dangerous creatures and their habitats. When the creatures escape from the briefcase, it sends the American wizarding authorities after Newt, and threatens to strain even further the state of magical and non-magical relations.','2016-11-16',133,180000000,'/1M91Bt3oGspda75H9eLqYZkJzgO.jpg','/6I2tPx6KIiBB4TWFiWwNUzrbxUn.jpg'),(33,'Ant-Man and the Wasp','Just when his time under house arrest is about to end, Scott Lang puts again his freedom at risk to help Hope van Dyne and Dr. Hank Pym dive into the quantum realm and try to accomplish, against time and any chance of success, a very dangerous rescue mission.','2018-07-04',119,140000000,'/rv1AWImgx386ULjcf62VYaW8zSt.jpg','/6P3c80EOm7BodndGBUAJHHsHKrp.jpg'),(34,'Guardians of the Galaxy','Light years from Earth, 26 years after being abduc...','2014-07-30',121,170000000,'/y31QB9kn3XSudA15tV7UWQ9XLuW.jpg','/bHarw8xrmQeqf3t8HpuMY7zoK4x.jpg'),(35,'Black Panther','King T\'Challa returns home from America to the rec...','2018-02-13',134,200000000,'/uxzzxijgPIY7slzFvMotPv8wjKA.jpg','/b6ZJZHUdMEFECvGiDpJjlfUWela.jpg'),(36,'The Avengers','When an unexpected enemy emerges and threatens glo...','2012-04-25',143,220000000,'/cezWGskPY5x7GaglTTRN4Fugfb8.jpg','/hbn46fQaRmlpBuUrEiFqv0GDL6Y.jpg'),(37,'Thor: Ragnarok','Thor is on the other side of the universe and find...','2017-10-25',130,180000000,'/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg','/r9DmhMfsndC8QtrXKyad3KCRdcC.jpg'),(38,'Avengers: Age of Ultron','When Tony Stark tries to jumpstart a dormant peace...','2015-04-22',141,280000000,'/t90Y3G8UGQp0f0DrP60wRu9gfrH.jpg','/rFtsE7Lhlc2jRWF7SRAU0fvrveQ.jpg'),(39,'Guardians of the Galaxy Vol. 2','The Guardians must fight to keep their newfound fa...','2017-04-19',137,200000000,'/y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg','/aJn9XeesqsrSLKcHfHP4u5985hn.jpg'),(40,'Captain America: Civil War','Following the events of Age of Ultron, the collect...','2016-04-27',147,240000000,'/kSBXou5Ac7vEqKd97wotJumyJvU.jpg','/m5O3SZvQ6EgD5XXXLPIP1wLppeW.jpg'),(41,'Ant-Man','Armed with the astonishing ability to shrink in sc...','2015-07-14',117,130000000,'/D6e8RJf2qUstnfkTslTXNTUAlT.jpg','/kvXLZqY0Ngl1XSw7EaMQO0C1CCj.jpg'),(42,'Thor','Against his father Odin\'s will, The Mighty Thor - ...','2